import classes from "./Interests.module.css";
const Education = (props) => {
  return (
    <div className={classes.interests} id="Education">
      <h2>Education</h2>
      <p>
        I have finished my BSc in Computer Science and Engineering (CSE) from
        BRAC University, Dhaka, Bangladesh.
      </p>
    </div>
  );
};
export default Education;
